import React from 'react'
import { connect } from 'react-redux'

/* imported images */

import Image1 from '../plantilla/img/product/most-product/m-product-1.jpg'
import Image2 from '../plantilla/img/product/most-product/m-product-2.jpg'
import Image3 from '../plantilla/img/product/most-product/m-product-3.jpg'
import Image4 from '../plantilla/img/product/most-product/m-product-4.jpg'
import Image5 from '../plantilla/img/product/most-product/m-product-5.jpg'
import Image6 from '../plantilla/img/product/most-product/m-product-6.jpg'
import Image7 from '../plantilla/img/product/most-product/m-product-7.jpg'
import Image8 from '../plantilla/img/product/most-product/m-product-8.jpg'
import Image9 from '../plantilla/img/product/most-product/m-product-9.jpg'
import Image10 from '../plantilla/img/product/most-product/m-product-10.jpg'
import Image11 from '../plantilla/img/product/most-product/m-product-11.jpg'
import Image12 from '../plantilla/img/product/most-product/m-product-12.jpg'

/* COMPONENTS ------------------------------*/

import RowSeached from './RowSearched.js'

/*------------------------------------------*/


const LastSearched = ({LSImg}) =>{
  
    return(
        <section className = " most_product_area ">
            <div className = " main_box ">
                <div className = "container">
                    <div className = "main_title">
                        <h2> Lo más buscado </h2>
                        <p> Las busquedas más recientes hechas por los usuarios </p>
                    </div>
                    <div className="row most_product_inner">
                    {  ()=>                      
                        {   
                            for(var i = 0 ; i < LSImg.length - 1; i = i + 3){                 
                                <RowSeached Image1 = {LSImg[i]} Image2 = {LSImg[i+1]} Image3 = {LSImg[i+2]} />
                            }	
                        }
                    }
                    </div>
                </div>
            </div> 
        </section>

    )
}
const mapStateToProps = state =>({
    LSImg : state.lsReducer
})

export default connect(mapStateToProps)(LastSearched)
